-- ----------------------------
--  Table structure for `on_pay_transfer`
-- ----------------------------
DROP TABLE IF EXISTS `on_pay_transfer`;
CREATE TABLE `on_pay_transfer` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `uid` bigint(11) NOT NULL COMMENT '转账人id',
  `realName` varchar(120) NOT NULL COMMENT '转账人名称',
  `friendid` bigint(11) NOT NULL COMMENT '好友id',
  `friendName` varchar(120) DEFAULT NULL COMMENT '好友名称',
  `amount` decimal(11,2) DEFAULT NULL COMMENT '金额',
  `isNotify` tinyint(255) DEFAULT '1' COMMENT '0：未通知 1：通知',
  `add_time` datetime DEFAULT NULL COMMENT '转账时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='转账记录表';


-- ----------------------------
--  Table structure for `on_payLog`
-- ----------------------------
DROP TABLE IF EXISTS `on_payLog`;
CREATE TABLE `on_payLog` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `log` varchar(255) DEFAULT NULL,
  `orderNo` varchar(255) NOT NULL,
  `add_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `on_user_account`
-- ----------------------------
DROP TABLE IF EXISTS `on_user_account`;
CREATE TABLE `on_user_account` (
  `uid` int(11) NOT NULL,
  `pay_password` varchar(512) DEFAULT NULL,
  `available_money` double(10,2) DEFAULT NULL,
  `freeze_money` double(10,2) DEFAULT NULL,
  `realname` varchar(20) DEFAULT NULL,
  `idcard` varchar(20) DEFAULT NULL,
  `updatetime` datetime DEFAULT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `on_user_bank`
-- ----------------------------
DROP TABLE IF EXISTS `on_user_bank`;
CREATE TABLE `on_user_bank` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `bank_id` bigint(11) DEFAULT NULL COMMENT '银行id',
  `bank_name` varchar(125) NOT NULL COMMENT '银行名称',
  `bank_code` varchar(125) NOT NULL DEFAULT '' COMMENT '银行编码',
  `card_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '银行卡类型:1:储蓄卡 2：信用卡',
  `card_no` varchar(125) NOT NULL COMMENT '银行卡号',
  `phone` varchar(125) DEFAULT NULL COMMENT '手机号码',
  `uid` bigint(11) DEFAULT NULL COMMENT '用户id',
  `bind_id` varchar(125) DEFAULT NULL COMMENT '平台绑定号',
  `bind_status` varchar(125) DEFAULT NULL COMMENT '平台绑定状态（支付人姓名）',
  `bind_order_no` varchar(125) DEFAULT NULL COMMENT '平台商户订单号',
  `status` tinyint(2) DEFAULT '1' COMMENT '0:有效，1：失效',
  `add_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户绑定银行卡';

-- ----------------------------
--  Table structure for `on_userpaylog`
-- ----------------------------
DROP TABLE IF EXISTS `on_userpaylog`;
CREATE TABLE `on_userpaylog` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` varchar(12) DEFAULT NULL,
  `allmoney` decimal(8,2) DEFAULT NULL,
  `paytouid` varchar(12) DEFAULT NULL,
  `paymoney` decimal(8,2) DEFAULT NULL,
  `paytype` int(11) DEFAULT NULL,
  `paymsg` varchar(50) DEFAULT NULL,
  `paytime` datetime DEFAULT NULL,
  `orderno` varchar(45) DEFAULT NULL,
  `lv` int(11) DEFAULT '0',
  `status` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5039 DEFAULT CHARSET=utf8;




SET FOREIGN_KEY_CHECKS = 1;
